  var js = "/**\n Template name: Bang-Olufsen Overlay v2\n URI: https://www.bang-olufsen.com\n Version 1.0.5\n */\nconst coiOverlay = document.getElementById('coiOverlay');\nconst wrapper = document.getElementById('coi-banner-wrapper');\nconst renewBtn = document.getElementById('Coi-Renew');\nconst purposesList = document.getElementsByClassName('coi-purpose-list');\nconst updateButton = document.getElementById('updateButton');\nconst declineButton = document.getElementById('declineButton');\nconst acceptButton = document.getElementById('acceptButton');\nconst coiShowDetails = document.getElementById('show_details');\nconst coiHideDetails = document.getElementById('hide_details');\nconst categoryDescriptionButtons = document.querySelectorAll('.coi-consent-banner__category-name');\nconst coiCheckboxes = document.querySelectorAll('.coi__checkbox');\nconst goToCoiPage1 = document.getElementById('coi-page-1');\nconst acceptAllButton = document.getElementById('accept-all-button');\nconst renewButton = document.getElementById('Coi-Renew');\n\n/* LOGO FUNCTION START */\nconst imagePath = ''; // Change this to your own logo URL\nconst container = document.getElementsByClassName('coi-banner__header');\n\nif (imagePath) {\n  for (let i = 0; i < container.length; i++) {\n    const logo = document.createElement('img');\n    logo.style.width = '180px'; // Change width for better fit\n    logo.src = imagePath;\n    logo.alt = 'logo';\n    container[i].insertBefore(logo, container[i].childNodes[0]);\n  }\n} else {\n  for (let i = 0; i < container.length; i++) {\n    var logo = document.createElement('span');\n    logo.setAttribute('aria-hidden', 'true');\n    container[i].insertBefore(logo, container[i].childNodes[0]);\n  }\n}\n/* LOGO FUNCTION END */\n\nfunction insertPurposesInList() {\n  if (purposesList) {\n    for (let i = 0; i < purposesList.length; i++) {\n      purposesList[i].innerHTML = document.getElementById('coi-banner-categories').innerHTML;\n    }\n  }\n}\n\nfunction trapFocusInModal(modalId) {\n  const modal = document.getElementById(modalId);\n  const focusableEl = modal.querySelectorAll(\n    'button:not([disabled]), a[href]:not([disabled]), input:not([disabled]), select, textarea:not([disabled]), [tabindex]:not([tabindex=\"-1\"])',\n  );\n  const firstFocusableEl = focusableEl[0];\n  const lastFocusableEl = focusableEl[focusableEl.length - 1];\n  const KEYCODE_TAB = 9;\n  wrapper.focus();\n\n  function ctlFocus(e) {\n    const isTabPressed = e.key === 'Tab' || e.keyCode === KEYCODE_TAB;\n    if (!isTabPressed) {\n      return;\n    }\n    if (e.shiftKey) {\n      /* shift + tab */ if (document.activeElement === firstFocusableEl) {\n        lastFocusableEl.focus();\n        e.preventDefault();\n      }\n    } else if (document.activeElement === lastFocusableEl) {\n      /* tab */\n      firstFocusableEl.focus();\n      e.preventDefault();\n    }\n  }\n  if (window.addEventListener) {\n    modal.addEventListener('keydown', ctlFocus);\n  } else if (document.attachEvent) {\n    // IE\n    modal.attachEvent('onkeydown', ctlFocus);\n  } else {\n    modal.addEventListener('keydown', ctlFocus);\n  }\n}\n\nfunction setConsentOption(state) {\n  if (state) {\n    declineButton.style.display = 'none';\n    updateButton.style.display = 'flex';\n    updateButton.setAttribute('role', 'alert');\n    updateButton.setAttribute('aria-atomic', 'true');\n    declineButton.removeAttribute('role');\n  } else {\n    updateButton.style.display = 'none';\n    declineButton.style.display = 'flex';\n    declineButton.setAttribute('role', 'alert');\n    declineButton.setAttribute('aria-atomic', 'true');\n    updateButton.removeAttribute('role');\n    updateButton.removeAttribute('aria-atomic');\n  }\n}\n\nfunction checkState() {\n  const checked = document.querySelectorAll('.coi__checkbox:not(#cookie_cat_necessary):checked');\n  if (checked.length > 0) {\n    setConsentOption(true);\n  } else {\n    setConsentOption(false);\n  }\n}\nconst checkboxes = document.querySelectorAll('.coi__checkbox:not(#cookie_cat_necessary)');\nfor (let i = 0; i < checkboxes.length; i++) {\n  checkboxes[i].addEventListener('change', function(el) {\n    checkState();\n  });\n}\n\n\n// Toggles the menu tabs in banner\nfunction TogglePage(id, element) {\n  const tabcontent = document.getElementsByClassName('coi-banner__page');\n  for (let i = 0; i < tabcontent.length; i++) {\n    tabcontent[i].style.display = 'none';\n  }\n  // Get all elements with class=\"coi-banner-tab\" and remove the class \"active\"\n  const tablinks = document.getElementsByClassName('coi-banner__nextpage');\n  for (let i = 0; i < tablinks.length; i++) {\n    tablinks[i].className = tablinks[i].className.replace(' activeTab', '');\n  }\n  // Show the current tab, and add an \"active\" class to the link that opened the tab\n  document.getElementById(element).style.display = 'block';\n  trapFocusInModal(element);\n  id.className += ' activeTab';\n}\n\nfunction toggleDetails(id) {\n  const categorieWrapper = document.getElementById('coiConsentBannerCategoriesWrapper');\n  const CoiCategory = document.querySelectorAll('.coi-consent-banner__category-name');\n  const CoiCategoryTab = document.querySelectorAll('.coi-consent-banner__description-container');\n\n  if (id === 'show_details') {\n    coiShowDetails.style.display = 'none';\n    coiHideDetails.style.display = 'block';\n\n    categorieWrapper.style.display = 'block';\n    categorieWrapper.setAttribute('aria-hidden', 'false');\n    for (let i = 0; i < CoiCategory.length; i++) {\n      CoiCategory[i].setAttribute('tabindex', 0);\n    }\n    CoiCategory[0].focus();\n  } else {\n    coiShowDetails.style.display = 'block';\n    coiHideDetails.style.display = 'none';\n\n    categorieWrapper.style.display = 'none';\n    categorieWrapper.setAttribute('aria-hidden', 'true');\n    for (let i = 0; i < CoiCategory.length; i++) {\n      CoiCategory[i].setAttribute('tabindex', -1);\n      CoiCategory[i].classList.remove('ci-btn-tab-active');\n    }\n    for (let i = 0; i < CoiCategoryTab.length; i++) {\n      if (CoiCategoryTab[i].classList.contains('tab-panel-active')) {\n        CoiCategoryTab[i].classList.remove('tab-panel-active');\n      }\n    }\n  }\n}\n\nfunction toggleCookieDetails(btn, tab) {\n  const tabContent = document.getElementById(tab);\n  btn.classList.toggle('ci-btn-tab-active');\n  if (btn.getAttribute('aria-expanded') === 'false') {\n    btn.setAttribute('aria-expanded', 'true');\n  } else {\n    btn.setAttribute('aria-expanded', 'false');\n  }\n\n  tabContent.classList.toggle('tab-panel-active');\n  if (tabContent.getAttribute('aria-hidden') === 'false') {\n    tabContent.setAttribute('aria-hidden', 'true');\n  } else {\n    tabContent.setAttribute('aria-hidden', 'false');\n  }\n\n  if (!tabContent.classList.contains('tab-panel-active')) {\n    const links = tabContent.querySelectorAll('a');\n    for (let i = 0; i < links.length; i++) {\n      links[i].setAttribute('tabindex', -1);\n    }\n  } else {\n    const links = tabContent.querySelectorAll('a');\n    for (let i = 0; i < links.length; i++) {\n      links[i].setAttribute('tabindex', 0);\n    }\n  }\n}\n\ncoiOverlay.addEventListener(\n  'click',\n  function(e) {\n    if (e.target == this) {\n      wrapper.classList.remove('ci-bounce');\n      wrapper.offsetWidth = coiOverlay.offsetWidth;\n      wrapper.classList.add('ci-bounce');\n    }\n  },\n  false,\n);\n\nfunction togglePlaceholderElementsOnConsent() {\n  const consentplaceholders = document.getElementsByClassName('consent-placeholder');\n  if (consentplaceholders) {\n    for (let i = 0; i < consentplaceholders.length; i++) {\n      if (\n        !window.CookieInformation.getConsentGivenFor(\n          consentplaceholders[i].getAttribute('data-category'),\n        )\n      ) {\n        consentplaceholders[i].style.display = 'block';\n      } else {\n        consentplaceholders[i].style.display = 'none';\n      }\n    }\n  }\n}\n\nfunction setNoScroll(state) {\n  const htmlElement = document.getElementsByTagName('html')[0];\n  if (state) {\n    htmlElement.classList.add('noScroll');\n  } else {\n    htmlElement.classList.remove('noScroll');\n  }\n}\n\n// Show and Hides the banner\nwindow.showCookieBanner = function() {\n  insertPurposesInList();\n  coiOverlay.style.display = 'flex';\n  // setNoScroll(true);\n  wrapper.setAttribute('aria-hidden', 'false');\n  coiOverlay.setAttribute('aria-hidden', 'false');\n  setTimeout(function() {\n    trapFocusInModal('coiPage-1');\n  }, 100);\n  checkState();\n\n  renewBtn.style.display = 'none';\n  togglePlaceholderElementsOnConsent();\n};\n\nwindow.hideCookieBanner = function() {\n  wrapper.setAttribute('aria-hidden', 'true');\n  coiOverlay.setAttribute('aria-hidden', 'true');\n  coiOverlay.style.display = 'none';\n  setNoScroll(false);\n\n  renewBtn.style.display = 'block';\n  togglePlaceholderElementsOnConsent();\n};\n\n\nacceptButton.onclick = window.CookieInformation.submitAllCategories;\nacceptAllButton.onclick = window.CookieInformation.submitAllCategories;\ndeclineButton.onclick = window.CookieInformation.declineAllCategories;\nupdateButton.onclick = window.CookieInformation.submitConsent;\nrenewButton.onclick = window.CookieConsent.renew;\ncoiShowDetails.onclick = function() {\n  toggleDetails('show_details');\n};\ncoiHideDetails.onclick = function() {\n  toggleDetails('hide_details');\n};\ngoToCoiPage1.onclick = function() {\n  TogglePage(this, 'coiPage-1');\n};\n\nfor (let i = 0; i < categoryDescriptionButtons.length; i++) {\n  categoryDescriptionButtons[i].onclick = function() {\n    toggleCookieDetails(\n      categoryDescriptionButtons[i],\n      categoryDescriptionButtons[i].dataset.descriptionContainer,\n    );\n  };\n}\n\nfor (let i = 0; i < coiCheckboxes.length; i++) {\n  coiCheckboxes[i].onclick = function() {\n    window.CookieInformation.changeCategoryConsentDecision(coiCheckboxes[i].id);\n  };\n}\n";
